import React from "react";
import { useHistory } from "react-router-dom";
import { useForm, Controller } from "react-hook-form";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import Button from "../../components/Button";
import RegisterTemplate from "../../components/RegisterTemplate";

function UserRegistration() {
  const {
    handleSubmit,
    formState: { isSubmitting },
  } = useForm({
    mode: "onBlur",
  });
  const history = useHistory();

  const onSubmit = () => {
    history.push(`/admin/users`);
  };

  return (
    <RegisterTemplate>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Controller
            name="fullname"
            render={({ field }) => (
              <TextField
                id="outlined-basic"
                label="Full name"
                variant="outlined"
                placeholder="Type the fullname of the user"
                fullWidth
                {...field}
              />
            )}
          />
        </Grid>
        <Grid item xs={12}>
          <Controller
            name="username"
            render={({ field }) => (
              <TextField
                id="outlined-basic"
                label="Username"
                variant="outlined"
                placeholder="Define a username"
                fullWidth
                {...field}
              />
            )}
          />
        </Grid>
        <Grid item xs={12}>
          <Controller
            name="password"
            render={({ field }) => (
              <TextField
                type="password"
                id="outlined-basic"
                label="Senha"
                variant="outlined"
                placeholder="Digite sua senha"
                fullWidth
                {...field}
              />
            )}
          />
        </Grid>
        <Grid item xs={12}>
          <Button onClick={handleSubmit(onSubmit)}>Register new user</Button>
        </Grid>
      </Grid>
    </RegisterTemplate>
  );
}

export default UserRegistration;
